var self = {};

self.getAllRecipesForConfiguration = function (configuration, callback) {
    var recipes = [];
    Object.keys(recipeStorage).forEach(function (recipeId) {
        recipes.push(recipeStorage[recipeId]);
    });

    if (typeof(callback) == 'function') {

        callback(null, recipes);
    }
};

self.getRecipeForId = function (recipeId, callback) {
    if (typeof(callback) == 'function') {
        callback(null, recipeStorage[recipeId]);
    }
};

self.createOfferForRequest = function (request, callback) {

    var offer = {
        id: 'OFFER_' + Object.keys(offerStorage).length,
        Invoice: {
            Expiration: new Date(new Date().getTime() + (2 * 60 * 60 * 1000)).toISOString(),
            Transfers: [
                {
                    Address: 'my1vtAh3gTZEPVmF7TGzzfmsf2wcTVaYUj',
                    Coin: getRandomIntInclusive(1, 1000)
                }, {
                    Address: '1FQ7LNa74kpimsb1g8s5gbG6P67yHb8njj',
                    Coin: getRandomIntInclusive(1, 1000)
                }
            ]
        }
    };

    offerStorage[offer.id] = offer;

    if (typeof (callback) == 'function') {
        callback(null, offer);
    }
};

self.getOfferForId = function (offerId, callback) {
    if (typeof(callback) == 'function') {
        callback(null, offerStorage[offerId]);
    }
};

self.savePaymentForOffer = function (offerId, payment, callback) {


    var offer = offerStorage[offerId];

    if (!offer) {
        if (typeof(callback) == 'function') {
            callback({
                message: 'Offer not found',
                status: 404
            });
        }
        return;
    }

    offer.payment = payment;
    offerStorage[offerId] = offer;


    if (typeof(callback) == 'function') {
        callback(null);
    }
};

self.getUserForId = function (userId, callback) {
    if (typeof(callback) == 'function') {
        callback(null, userStorage[userId]);
    }
};


module.exports = self;


function getRandomIntInclusive(min, max) {
    min = Math.ceil(min);
    max = Math.floor(max);
    return Math.floor(Math.random() * (max - min + 1)) + min;
}